svg.script:

document.addEventListener('DOMContentLoaded', function() {
  // Interactive elements
  const milestoneStatuses = document.querySelectorAll('.milestone-status');
  const teamMembers = document.querySelectorAll('.team-member');
  const controlButtons = document.querySelectorAll('.control-btn');
  const blockerIndicators = document.querySelectorAll('.blocker-indicator');

  let trackerState = {
    currentWeek: 4,
    totalWeeks: 12,
    completedMilestones: 8,
    totalMilestones: 24,
    teamVelocity: 95,
    riskLevel: 'medium',
    successPrediction: 87
  };

  // Milestone status interaction
  milestoneStatuses.forEach(milestone => {
    milestone.addEventListener('click', function() {
      const status = this.classList.contains('completed') ? 'completed' :
                    this.classList.contains('in-progress') ? 'in-progress' :
                    this.classList.contains('pending') ? 'pending' : 'blocked';

      showMilestoneDetails(this, status);

      if (typeof window.showMilestoneDetails === 'function') {
        window.showMilestoneDetails(this, status);
      }
    });

    milestone.addEventListener('keydown', function(e) {
      if (e.key === 'Enter' || e.key === ' ') {
        e.preventDefault();
        this.click();
      }
    });
  });

  // Team member interaction
  teamMembers.forEach(member => {
    member.addEventListener('click', function() {
      const memberType = this.getAttribute('data-member');
      showTeamMemberDetails(memberType);

      if (typeof window.showTeamMemberDetails === 'function') {
        window.showTeamMemberDetails(memberType);
      }
    });
  });

  // Control button interaction
  controlButtons.forEach(btn => {
    btn.addEventListener('click', function() {
      const action = this.getAttribute('data-action');
      executeTrackerAction(action);

      if (typeof window.executeTrackerAction === 'function') {
        window.executeTrackerAction(action);
      }
    });
  });

  // Blocker indicator interaction
  blockerIndicators.forEach(blocker => {
    blocker.addEventListener('click', function() {
      showBlockerDetails(this);

      if (typeof window.showBlockerDetails === 'function') {
        window.showBlockerDetails(this);
      }
    });
  });

  // Helper functions
  function showMilestoneDetails(element, status) {
    const title = element.querySelector('title');
    const milestoneInfo = title ? title.textContent : 'Milestone details';

    if (typeof window.displayMilestoneInfo === 'function') {
      window.displayMilestoneInfo(milestoneInfo, status);
    } else {
      console.log(`Milestone: ${milestoneInfo}, Status: ${status}`);
    }
  }

  function showTeamMemberDetails(memberType) {
    const memberDetails = {
      'lead': { name: 'Tech Lead', capacity: '90%', currentTask: 'Architecture review' },
      'dev1': { name: 'Developer 1', capacity: '70%', currentTask: 'AI integration' },
      'dev2': { name: 'Developer 2', capacity: '80%', currentTask: 'Testing setup' },
      'qa': { name: 'QA Engineer', capacity: '60%', currentTask: 'Test planning' }
    };

    if (typeof window.displayTeamMemberInfo === 'function') {
      window.displayTeamMemberInfo(memberDetails[memberType]);
    }
  }

  function executeTrackerAction(action) {
    const actions = {
      'update-progress': () => updateMilestoneProgress(),
      'view-details': () => showDetailedTimeline(),
      'adjust-schedule': () => adjustSchedule(),
      'team-coordination': () => openTeamCoordination(),
      'resolve-blockers': () => resolveBlockers()
    };

    if (actions[action]) {
      actions[action]();
    }
  }

  function updateMilestoneProgress() {
    if (typeof window.updateProgress === 'function') {
      window.updateProgress();
    } else {
      console.log('Updating milestone progress...');
    }
  }

  function showDetailedTimeline() {
    if (typeof window.showTimeline === 'function') {
      window.showTimeline();
    } else {
      console.log('Showing detailed timeline view...');
    }
  }

  function adjustSchedule() {
    if (typeof window.adjustSchedule === 'function') {
      window.adjustSchedule();
    } else {
      console.log('Opening schedule adjustment interface...');
    }
  }

  function openTeamCoordination() {
    if (typeof window.openTeamPanel === 'function') {
      window.openTeamPanel();
    } else {
      console.log('Opening team coordination panel...');
    }
  }

  function resolveBlockers() {
    if (typeof window.resolveBlockers === 'function') {
      window.resolveBlockers();
    } else {
      console.log('Opening blocker resolution interface...');
    }
  }

  function showBlockerDetails(blocker) {
    if (typeof window.showBlockerDetails === 'function') {
      window.showBlockerDetails(blocker);
    }
  }

  // Real-time updates
  function updateTrackerMetrics() {
    if (typeof window.updateMetrics === 'function') {
      window.updateMetrics();
    }
  }

  function syncProgress() {
    if (typeof window.syncProgress === 'function') {
      window.syncProgress();
    }
  }

  function validateMilestones() {
    if (typeof window.validateMilestones === 'function') {
      window.validateMilestones();
    }
  }

  // Initialize tracker
  if (typeof window.initializeMilestoneTracker === 'function') {
    window.initializeMilestoneTracker(trackerState);
  }

  // Periodic updates
  setInterval(updateTrackerMetrics, 60000); // Update every minute
  setInterval(syncProgress, 300000); // Sync every 5 minutes
  setInterval(validateMilestones, 900000); // Validate every 15 minutes
});
